import { useEffect, useState } from "react";
import moment from "moment-timezone";

function App() {
  const [time, setTime] = useState(moment().format("LTS"));

  useEffect(() => {
    setInterval(() => setTime(moment().format("LTS")), 1000);
  }, [time]);

  return (
    <h1>
      {time}
      <p>{moment.tz(time, "America/Toronto")}</p>
    </h1>
  );
}

export default App;
